import { Query } from 'react-apollo';
import gql from 'graphql-tag';

export const TEST_QUERY = gql`
  query GET_POSTS {
    activities {
      edges {
        node {
            title
        }
      }
    }
  }
`;

const Index = () => (
  <div>
    <Query query={TEST_QUERY}>
      {({ data }) => {
      console.log(data)
        return (
          <div>
            <p>{data.title}</p>
          </div>
        );
      }}
    </Query>
  </div>
);

export default Index;
